xyeTSZoLuf/2Q==","owner":{"id":"2173086249","username":"thescribbledstories"},"is_video":false,"accessibility_caption":"Photo shared by The Scribbled Stories on May 05, 2020 tagging @omair.tarique. Image may contain: 1 person, text","edge_media_to_caption":{"edges":[{"node":{"text":"Kabira\n\nDo you remember that kid in your class, that one kid who would be lost in his own world? Perhaps there's a Kabir inside all of us. And this song is an ode to that wanderlust, ambitious Kabir inside us.\n\nIt is a story of sacrifices one makes to become great. Dreams are expensive. They can cost you everything. Even Kabir realises this in the end.\n\nThere is a conflict within you \u2013 a restlessness because you\u2019ve followed all your dreams, and yet, you are nowhere. You\u2019re that saint who sits in the Himalayas for peace but never finds it. You're that person who finds everything in life and still feels empty.\n\nKisi thor tike na paaon. The restlessness within you never really goes away. You just can't stay in one place. The habit of chasing something is swallowing you from the inside, Kabir.\n\nKabira maan ja. This line is perhaps about forgiving yourself for the decisions you've taken. It's okay, come back home. Mourn the losses. Even your shadows are calling you now.\n\nYou\u2019re only without your shadow when you\u2019re in the darkness, and the line \u201cAa jaa tujh ko pukaare teri parchhaaiyaan\u201d is a reminder to come back home. You\u2019re never truly lost.\n\nKabira is a reminder that someone will always wait for you. You might never know. You might even walk away from them, but they will continue to wait. They\u2019ll move on with their lives, but for them, the wait never really ends.\n\nWe all know a Kabir who is impulsive, a nomad. He's detached from the world. Someone who wants to live life, one day at a time. They know what they truly want\u2026 and they\u2019ll sacrifice anything to get there. This is a song for the ones who are so busy trying to chase something that they lose themselves in the process.\n\nYou play this song on a solo-trip when you\u2019re on the bus or a train. Your head against the windowpane, the world takes a backseat. You\u2019re left with emptiness, a conflict, a voice that says, to stop running, to find a place, to return to your lover. \nFakeera, let go of this search which will end in you finding nothing. Come back home. This feeling of emptiness won't go away. Just come home to someone. To some place.\n___\n\nbreakingdownmusic by us"}}]},"edge_media_to_comment":{"count":324},"comments_disabled":false,"taken_at_timestamp":1588664661,"edge_liked_by":{"count":98399},"edge_media_preview_like":{"count":98399},"location":null,"thumbnail_src":"https://instagram.fmaa2-2.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/s640x640/95583185_598237784118248_4287471645872829789_n.jpg?_nc_ht=instagram.fmaa2-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=lBCjYWT2I0wAX9ARHnD\u0026oh=bbda82fea4b2f291ce6b67c983ccabdf\u0026oe=5EE4821B","thumbnail_resources":[{"src":"https://instagram.fmaa2-2.fna.fbcdn.net/v/t51.2885-15/e15/s150x150/95583185_598237784118248_4287471645872829789_n.jpg?_nc_ht=instagram.fmaa2-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=lBCjYWT2I0wAX9ARHnD\u0026oh=1a55ed40b268e1f2e1a7ae10e1b6ad52\u0026oe=5EE2859D","config_width":150,"config_height":150},{"src":"https://instagram.fmaa2-2.fna.fbcdn.net/v/t51.2885-15/e15/s240x240/95583185_598237784118248_4287471645872829789_n.jpg?_nc_ht=instagram.fmaa2-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=lBCjYWT2I0wAX9ARHnD\u0026oh=2870d2666c42d7a3850c9f34aa340b73\u0026oe=5EE52A57","config_width":240,"config_height":240},{"src":"https://instagram.fmaa2-2.fna.fbcdn.net/v/t51.2885-15/e15/s320x320/95583185_598237784118248_4287471645872829789_n.jpg?_nc_ht=instagram.fmaa2-2.fna.fbcdn.net\u0026_nc_cat=108\u0026_nc_ohc=lBCjYWT2I0wAX9ARHnD\u0026oh=000613ea476fce0a8e16e17ef81deb6c\u0026oe=5EE5E1ED","config_width":320,"config_height":320},{"src":"https://instagram.fmaa2-
